struct node2{
	ll data;
	int vi;
	int vj;
	node2() :data(0), vi(0), vj(0){}
};
struct priority_q{
	node2 heap[MAX_SSD_SIZE + 10];
	int idx[NUMBER_OF_VIDEO + 3][3010];
	int size;
	priority_q() :size(0){}

	node2 top(){
		return heap[1];
	}
	void swap(int idx1, int idx2) {
		int vi1 = heap[idx1].vi;
		int vj1 = heap[idx1].vj;
		ll val1 = heap[idx1].data;
		int vi2 = heap[idx2].vi;
		int vj2 = heap[idx2].vj;
		idx[vi1][vj1] = idx2;
		idx[vi2][vj2] = idx1;
		heap[idx1].data = heap[idx2].data;
		heap[idx1].vi = vi2;
		heap[idx1].vj = vj2;
		heap[idx2].data = val1;
		heap[idx2].vi = vi1;
		heap[idx2].vj = vj1;
	}
	void upheap(int cidx) {
		if (cidx == 1) return;
		int pidx = cidx / 2;
		if (heap[pidx].data <= heap[cidx].data) return;
		swap(cidx, pidx);
		upheap(pidx);
	}
	void downheap(int cidx) {
		int lidx = cidx * 2;
		if (lidx > size) return;
		if (lidx + 1 <= size) {
			if (heap[lidx].data > heap[lidx + 1].data) lidx++;
		}
		if (heap[cidx].data <= heap[lidx].data) return;
		swap(cidx, lidx);
		downheap(lidx);
	}
	void pop(){
		if (size == 0) return;
		heap[1].data = heap[size].data;
		heap[1].vi = heap[size].vi;
		heap[1].vj = heap[size].vj;
		idx[heap[1].vi][heap[1].vj] = 1;
		size--;
		downheap(1);
	}
	void push(ll val, int ci, int cj) {
		size++;
		heap[size].data = val;
		heap[size].vi = ci;
		heap[size].vj = cj;
		idx[ci][cj] = size;
		upheap(size);
	}
	void update(ll val, int ci, int cj) {
		int hidx = idx[ci][cj];
		heap[hidx].data = val;
		downheap(hidx);
	}
};

