// Zipf distribution with theta parameter, size = movie number, theta =0.271
void find_prob(double *prob, int size, double theta)
{
	double G_factor = 0;
	int i;
	double temp = 0;

	for (i = 1; i <= size; i++)
		G_factor += 1 / pow(i, theta);

	G_factor = 1.0 / G_factor;

	for (i = 0; i<size; i++)
	{
		prob[i] = G_factor / pow(i + 1, theta);
		temp += prob[i];
	}
}